import React from 'react';
import { View, Text } from 'react-native'; 

const containerStyle = {
    marginTop: 25,
    backgroundColor: '#ff550f'
}

const Header = props => (
    <View style={containerStyle}>
        <Text>Lista de Contatos</Text>
    </View>
);

export default Header;
